import classes from './MealsSummary.module.css';

const MealsSummary = () => {
    return (
        <section className={classes.summary}>
            <h2>Delicious Food, delivered to Your Home</h2>
            <p>Choose your favorite meal from our broad selection 
                of available meals and enjoy a delicious lunch or dinner at home.</p>
            <p>All our meals are prepared with high-quality ingredients, 
                just-in-time and by experienced chefs!</p>
        </section>
    )
}
